import styled from 'styled-components';
import Link from 'next/link'

export const HeaderContent = styled.div`
    width: 100%;
    height:80px;
    display: flex;
    justify-content: flex-start;
    align-items: center;
`;

export const HeaderLogo = styled(Link)`
    font-size: 24px;
    text-decoration: none;
    margin-left: 25px;
`;
